g. On XXXX XXXX, XXXX I called USAA and after speaking with XXXX different departments, I \'m then transferred to ext. XXXX and spoke with XXXX inquiring about a lien release. She advised a lien release would occur if the balance of {$19000.00} is paid in full. I explained to her the conversation I had with the Bankruptcy Department on XXXX XXXX and she advised that she was n\'t involved in that conversation and did n\'t know what I was told. I then asked about some sort of a negotiated amount. She advised there \'s a member assistance program and faxed an application. We filled out all of the documentation including a hardship letter and faxed in our request XXXX XXXX, XXXX. We receive a call from XXXX XXXX ( I \'m not certain if it \'s the same XXXX who \'m I spoke with on XXXX XXXX ) stating that it seemed that we wanted to request a settlement option, not a sell short. I advised that is correct. I advised how our house is under contract and has a closing date of XXXX XXXX. She advised that USAA legally has 30 days to make a decision and as of now, our request is incomplete. She asked for a mortgage loan payoff from BAC and pay-stubs. These items were faxed on XXXX XXXX, XXXX. Our closing date is then moved to XXXX XXXX, XXXX. We also agree to pay our buyer \'s rent for the month of XXXX. On XXXX XXXX, XXXX, I received an email from XXXX XXXX stating USAA rejected our settlement offer. On XXXX XXXX, XXXX, I then submitted a counteroffer and that too was rejected. I spoke with XXXX XXXX on XXXX XXXX, XXXX for further clarification. She advised that since we have sufficient equity in the house to cover the lien, all counters will be rejected. The full loan amount is expected from us in order to lift the Lien.','Company believes it acted appropriately as authorized by contract or law','2016-12-08',1,0),(312,8,2,8,56,'','','2014-06-13',1,0),(313,63,7,22,42,'','','2017-01-27',1,0),(314,103,1,6,19,'','','2014-09-15',1,0),(315,2,2,51,6,'','','2013-10-08',1,0),(316,93,5,