ed the day with a positive balance and ended the day with a positive balance having deposited XXXX into my account. Yet I bounced XXXX items, though I was only charged for XXXX. this is very unclear unprofessional accounting. If I did not have direct deposits coming into this account, I would close it. And the thing about it is that it would not matter to key bank at all if they lost my business. They do not care about their customers as evidenced by the fact that I have spent a lot of time this week complaining because of their over draft practices and they keep overdrafting me even with a positive balance. Get it together Key Bank. Adding and Subtracting are basic math skills that you should have. Stop reordering items to benefit yourselves. Give people a break. Last month you bounced XXXX debit transactions of mine that came all together to a little over XXXX You made almost XXXX $ off of those transactions.','','2015-11-21',1,1),(369,2,2,2,34,'I have gone back and forth with both Transunion and XXXX credit reporting agencies. I have disputed and disputed, and they remove some things and then reinsert them again, making my score go down by over XXXX points. I do n\'t know what to do as the debts they are talking about are in most cases over 7 years old, and in the State of Nevada, credit card debt is only collectible for4 years. They are ruining my credit, and I ca n\'t get another card to pay off a high interest card with a no interest card. The new ones in question are from long ago charged off credit cards from XXXX. I am attaching a letter sent to them to inform the credit card companies of the charged off nature of the XXXX accounts. They are from XX/XX/XXXX and XX/XX/XXXX.','Company chooses not to provide a public response','2015-06-24',1,0),(370,31,7,17,28,'','','2015-01-14',1,0),(371,3,3,3,18,'In XXXX of XXXX I bought a new car. The dealer told me that I would be contacted by Citizen One ( then RBS Citizens ) about the exact amount of each monthly payment and about the exact date each payment would be due. Sometime shortly after that Citizen One sent me my first monthly billing statement. For the next 2 1/2 years Citizen One set a precedent and created an expectation by regularly sending me monthly billing statements. During that time I faithfully made each payment on time and, on several occasions, made monthly payments for several months in advance. For these reasons I relied on receiving my monthly billing statement from Citizen One to know the exact amount of and the exact due date of my next loan installment. In XXXX XXXX Citizen One suddenly and unexpectedly stopped sending me billing statements. I did n\'t notice ( I had been habituated by their monthly notices and I had been trained to think of sending a payment only after I was notified ) and, as a direct result of Citizen One \'s failure to send a monthly billing statement, I was late with my XXXX payment. When their credit department contacted me I sent 2 months payments ( current + one month in advance ) and notified them that I had n\'t received a statement. Their customer service representative told me that I should have received a monthly billing statement, it was Citizen One \'s policy to do so, verified my contact information ( which had n\'t changed ) and, under the circumstances, waived the {$20.00} fee I had been assessed for being late. She also assured me that I would start to receive monthly billing statements again. Unfortunately, I did not. Nor did I notice. As a result of that failure on the part of Citizen One I was again contacted in XXXX by their credit department that I was late again. I immediately made 2 months payments ( current + one month in advance ) and pled with their customer service department to please get a monthly billing statement to me. Mail it, fax it, e-mail it - I did n\'t care. Just get one to me. This time they promised to mail me a paper statement and e-mail me my reminders. To date I have n\'t received either. As a result I was late again in XXXX. I am not accusing Citizen One of intentionally withholding my monthly billing statements but I find it very suspicious that all of my other mail is delivered without incident. I am never - and I do mean never - late with any of my other bills. I also find it convenient ( and profitable ) that Citizen One gains from their own failure! They are now refusing to waive XXXX {$20.00} late fees. Something is very wrong on their end and it is entirely unfair that I am being penalized for not being sent a monthly billing statement which serves as notification that a loan payment in a specific amount is due. Furthermore, I should not be charged {$20.00} fees when my payment is late as a result of neglect or failure on Citizen One \'s part to send me a monthly billing statement. I suspect that I am not the only customer of Citizen One with this problem. I have made exhaustive efforts to remedy this issue with the bank but they are intransigent and so I am filing this compliant to get this situation resolved and, on the principles of being fair and taking responsibility for their part in creating this problem, get the outstanding late fees waived and ensure delivery of a monthly billing statement.','','2016-04-29',1,0),(372,30,1,12,42,'','','2012-01-23',1,1),(373,15,2,2,38,'','','2013-01-18',1,0),(374,17,4,11,39,'','','2012-10-24',1,1),(375,5,4,55,36,'I have a Citi Bank Att Universal credit card for over 13 y years. I can not manage my account on line since the the account is closed and I am not allowed online access. \nI have to contact customer service by phone in order to make changes or discuss my account. My complaint is about the customer service representatives. They are not professional and totally incompetent. I requested to have my automatic payment reduced from {$250.00} per mo. \nto {$120.00} and 3 different representatives assured me ( including a supervisor ) that the change was made but it was not. Since I can not manage my account online I have no recourse but to rely on customer service reps. \nLast night a rep was just telling me anything and I knew it was incorrect. She was a foreignor and she was totally incompetent and even lied about my account. I want to file a formal complaint about Citi Bank and take any necessary steps to do whatever to have this issue resolv resolved for me.','Company has responded to the consumer and the CFPB and chooses not to provide a public response','2016-06-29',1,0),(376,17,4,56,38,'I had gone into a Wells Fargo bank when I lived in XXXX XXXX California because I lost my Debit card, the teller had me meet with one of the managers at his desk, and they tried to talk me into a college credit card I told him I did n\'t want another credit card and no thank you I just needed a replacement debit card. Two weeks later I received a credit card and a debit card in the mail. I was so aggravated I worked XXXX jobs and was taking XXXX units in college I did n\'t have time to go to the bank or to sit on the phone right away to cancel the card. Within a couple of weeks I had a small overdraft and it went strait onto the credit card and at that point I knew this was going to show up on my credit report and I was trying to keep my revolving credit low. Since then I have been trying to pay this card off and close the account but it has cause me to have late payments and has just been a devstaing to my creidt and has blocked me from buying the home of my dreams.This card has been nothing but a headache affecting my ability to get a home, and a new car with a good rate this has been haunting me for a little while now. I had gone into the bank since then and told the teller and she stated I would have to call the bank. I was so shocked that someone could do this and they do n\'t even want to fire the guy, he was there at work that day I went in and pointed him out to the teller and all she said was to call. XXXX','Company has responded to the consumer and the CFPB and chooses not to provide a public response','2016-09-11',1,0),(377,122,8,31,44,'','','2014-10-20',1,0),(378,17,1,1,56,'','','2012-12-05',1,0),(379,27,7,17,52,'XX/XX/XXXX, I submitted a letter to close my account with Ally Bank. XX/XX/XXXX, having not yet received a check, I called to understand status on XXXX XXXX, 2016. They said they mailed the check and would need to reissue a new check. Given the amount ( over {$190000.00} ), I asked them to expedite whatever paperwork was necessary. On XXXX XXXX, I had still not received any paperwork, so again called. They said they had not done anything as a result of my original request, but would send paperwork via email. Since I was traveling, I did not have access to a printer and the paperwork \" expired \'\' after 8 hours. The access to the paperwork was laborious at best as it was sent through a secured site. On XXXX XXXX, I called Ally Bank again ( spend another 30 minutes on the phone ) and they again indicated they would send out paperwork which would need to be notarized. They also indicated they had not yet cancelled the check. A few questions : 1 ) Why did they not immediately cancel the check on XXXX XXXX when I originally notifified them the check had been lost? \n2 ) Why did they not send out the paperwork after the XXXX XXXX call? \n3 ) Why does the paperwork expire after 8 hours so the consumer can not get access to their funds. Since I was traveling, this delayed me yet another 2 weeks? \n4 ) Why does the paperwork have to be notarized and why does it have to be sent through a secured site. On XXXX XXXX, the check had not been cashed, so I do not understand why this level of difficulty in getting access to my funds. \n5 ) Are they making the process inordinately difficult in order to keep my funds, in hopes XXXX XXXX not be relentless enough to spend hours on the phone, find a notary, decode a difficult and confusing software to access the paperwork and hope that they expedite my check and actually deliver it this