d to re-sign and submit the documents again. I did so. My new address ( across the country ) was shown on the documents I electronically signed. I was contacted again in XXXX. XXXX. I was told again that my documents had not been returned and that I was not in rehabilitation. At this point, I have made 18 consecutive payments. The agency sent my \" loan agreement \'\' ( which is the most important document of the bunch ) to my former address even with my correct address on the income/expense and other documents. I am trying to qualify for a home loan and I show that I am still in default. The agency wants me to re-sign the documents for a 3rd time in order for me to begin the rehabilitation process. By the time it is finished, assuming that this time they will send me ALL of the documents I need to complete this program, it will have taken me 27 months to \" complete \'\' the rehabilitation process. The agency is telling me now that my options are to try to begin again and they have assured me that I will get all of the documents \" this time \'\' or to pay the full balance and still have the default notation which may prevent me from being able to qualify for a home loan until another 9 months has passed or even longer to wait for the notation to be removed. I was told that if I had returned the \" loan agreement \'\' then this would not be a problem. But I do n\'t think I have ever been sent one. This agency sends documents to \" qualify \'\' for the program including setting up a payment then is supposed to send a \" loan agreement \'\' to be signed and returned. However the only things I have received from this agency are the \" qualifying \'\' documents and the monthly notice of the payment.','Company has responded to the consumer and the CFPB and chooses not to provide a public response','2016-04-20',1,0),(403,8,2,2,34,'','','2014-12-29',1,0),(404,130,5,10,7,'This complaint is being filed against Stellar Recovery in regards to the above reference account that 