r problem with their closing the account was that they did it around XX/XX/XXXX -- against my wishes -- and at a time when the value of investments in the account had plunged. These investments soon rebounded and even gained in value. However, I missed out on these earnings. I filed a complained with the BBB and the bank restored opened an account in my name and cancelled payment on the check to me. However, the bank has refused to provide me with information about the value of the account as of the date of my husband \'s death and the holdings in the investment accounts as of his death and as of the date they sold the investments. As the law says I should \" assume \'\' this account, I am entitled to this information. I have attempted to get the information from the bank but they refuse. I have no way to know if they restored the correct amount to the account. The bank later made a cash deposit to the account, apparently correcting some error. However, I have no information to assess what they have done. In effect, the bank erroneously made the only investment decisions for the account until I sold the investments in XX/XX/XXXX as I prepare to move the account to an HSA administrator that is more professional. The bank \'s website information about the treatment of HSA accounts upon accountholder \'s death has changed more than once since my husband \'s death and now says the bank has discretion about the treatment of accounts upon death. Are accountholders subject to the whims of a bank clerk? I believe the bank has callously violated my rights and that I have suffered a financial loss as a result. Without all of the required information, it is difficult to assess the damage, but I believe that if the account had simply been changed to my name there would be several more thousand dollars in it than there is now. To make matters worse, this debacle occurred when I was already struggling with the effects of my husband \'s death. While other financial institutions we