p tracing my account because they did not have a good number for my account. Advised that they had my cell # & that was good because they call me all the time for collections. \nOn XXXX, I called trying to get better contact information regarding my account as I was intending to pay it off and spoke to XXXX, I was then transferred to manager, XXXX XXXX XXXX. XXXX as my account had a Cease & Desist flag placed on it due to the issues I experienced when I called in & with receiving a collection call at my employer. Call was disconnected. \nOn XXXX, I called spoke to XXXX about payoff procedures. \nOn XXXX, I received a loan from my bank & asked the company to send a XXXX-day payoff via fax so the bank had the correct amount. The only piece of information I had to give to the bank for debt validation was the incorrect demand letter I had to previously request from FMS - it did not reflect XXXX payments I had made on my account. I had asked for the updated amount to be sent to my bank - FMS failed to send anything in writing. When I spoke to XXXX, I requested the correct amount to be sent to my bank again & also requested copies of my receipts for my XXXX payments sent to me. I was told that due to privacy issues, I can not get receipts for my payments, rather I can use my own bank statements. When I called in on XXXX, she advised that there was a note on my account by the manager to immediately fax the correct payoff letter & my receipts to the bank. I called my bank to verify & they still had yet to receive any faxes from FMS. Instead, my bank used my \" demand letter \'\' ( again, previously requested by me, not sent by the FMS per law ) & the XXXX payments I stated I had made in order to send a check for the amount of {$3900.00}. Since there was n\'t any late fees or interest accruing, I knew this was the balance, although I did not have proof from FMS. After allowing time for the payment to be received, I called back on XXXX and spoke to XXXX, stated check was received/applied on XXXX. When I asked about receipts, he stated he would send me back to XXXX since we had spoken before. She advised that FMS was unable to provide due to privacy & legal issues. I continued checking w/ my bank who never received any information from FMS. I called back on XXXX & XXXX transferred me to XXXX XXXX, who is very rude, interrupts conversation, acts like he is inconvenienced to be on the phone. I asked for a new manager and was xfer to XXXX. Explained situation again, said he would have to speak to XXXX XXXX & call me back in XXXX mins. Received call XXXX hrs later & said he would have to call me back the following day. No return call.','','2015-09-10',1,1),(679,49,4,21,6,'','','2017-04-20',1,0),(680,17,7,17,52,'','Company has responded to the consumer and the CFPB and chooses not to provide a public response','2016-12-21',1,0),(681,125,5,23,52,'I had a line of credit loan with a bank which I got behind on. It got turned over to LTD Financial Service Debt collections. They called and asked me to get another loan to pay XXXX % of the debt. They said if I did n\'t they would sue me and according to the terms of my original loan I would be responsible for all the layers fees. \n\nI could not get a loan but plan to get a XXXX job. LTD Financial offered to take a large payment followed by regular monthly payments. I said that would work as soon as I started the XXXX job. They asked for my bank account number to make automatic drafts. I asked for this in writing and they refused and again said they were making the offer as a good faith effort to avoid litigation. I refused to hand over my bank account without a written agreement. \n\nLTD Financial then started calling my wife at work and telling her I was being uncooperative and she had to work with them. \n\nI plan to get an attorney.','','2015-11-19',1,0),(682,186,5,10,6,'I was not aware I owed this debt through this collector. I got my credit file this year and saw this. I have not received any 