s, Social Security numbers, email addresses, pass words, etc. had been stolen. Obviously, this is where the suspect in the XXXX fraudulent account obtained my name and Social Security number. On XXXX XXXX, 2015, I called XXXX XXXX Fraud Department. I advised them that Equifax claims that they did not send a letter to remove the fraudulent credit check. I was informed that this was not true. While on the telephone, the employee typed out another letter to Equifax and sent it. On XXXX XXXX, 2015, I called Equifax again. The credit check XXXX is still showing on my credit report. The employee at Equifax told me that they have no documentation showing this credit check to be a fraud. I told the employee that she is a liar. I stated that I have the confirmation in which I faxed them my statement along with the XXXX letter. I then informed the employee that XXXX sent them another letter and I wanted to speak to a supervisor. The employee stated that there was nothing that could be done for me and the credit check only lasts on my report for two years. I told her that she was complicit in this fraud complaint and that she is a liar. As a result of this last conversation with Equifax, I contacted the Attorney General \'s Office and was advised to file this complaint. See the attached documentation. I need this fraudulent credit check removed by Equifax.','','2015-07-29',1,1),(738,31,1,1,38,'','','2012-05-25',1,0),(739,39,1,1,26,'','','2013-04-19',1,1),(740,30,3,3,17,'','','2016-09-30',1,0),(741,27,7,22,17,'Sent an electronic message to Ally customer service via their website asking \" I can transfer funds with next day delivery using your website from my XXXX account, but if I schedule recurring transfers there is a several-day delay. Why is this the case? Can you fix it? \'\' I received what I feel was a complete non-answer, what appeared to be boilerplate text describing their manual funds transfer policy.','Company has responded to the consumer and the CFPB and chooses n