XXX intended to terminate my ability to maintain my XXXX while I was XXXX in XXXX. This has resulted in me being unqualified to continue working in my field of expertise, as I had for the past 25 years. I have found evidence that Equifax has been re-aging the original accounts reported by my creditors and this is the negative account information that was provided to the XXXX. Accounts that transferred or sold from one debt collector to another, and the date of first activity on the accounts make the delinquency look more resent, the dates of the first delinquency should not change. The date of first delinquency determines how long a negative account can remain on your credit reports and a negative credit item, such as a charge-off can only remain on my credit report for 7 years from the date of first delinquency. Section 623 ( 5 ) ( A ) says : \" In general. A person who furnishes information to a consumer reporting agency regarding a delinquent account being placed for collection, charged to profit or loss, after furnishing the information, notify the agency of the date of delinquency on the account, which shall be the month and year of the commencement of the delinquency on the account that immediately preceded the action. \'\' This means that if a debt collector reports a date of first delinquency to the credit bureaus and the original creditor previously reported it, the dates must be the same date of first delinquency. Any different date constitutes illegal re-aging. This re-aging of my accounts has cause serious damage to my credit files, I \'m hoping that this will be corrected quickly since I am provided my previous credit reports as attachments as evidence of the original dates of the first delinquency reported. The Credit Report I received from Equifax would be empty if not for the re-aging of the remaining accounts on your credit report, because the FCRA requires that information reported be in compliance with the date of first delinquency and the name of the party who reported the date of first delinquency. XXXX XXXX filed their first notice of delinquency when I requested that the SCRA interest rate adjustment to the account because I had been making payments in access of the required amounts and the balance of the account was n\'t reflecting that. Their attorney stated that XXXX XXXX was n\'t required to grant my request for the SCRA because the contract interest rate was below 5 % and any excess payments were applied to the other fees and charges. XXXX does n\'t have the legal right to deny mt SCRA request without first having a court order granting them the right not to comply with the Federal Statutes of the SCRA Financial protections and the SCRA Interest Rate provision requires a creditor not to accelerate the account for non payments of the obligation until the SCRA requirements are in compliance, ignoring my SCRA request is n\'t permitted without a court order and the attorney should have known.','','2017-01-26',1,1),(933,39,5,10,27,'','Company chooses not to provide a public response','2015-09-22',1,1),(934,30,1,12,13,'','','2013-02-14',1,0),(935,57,7,25,46,'I have a account with XXXX other pnc users but after alittle while i noticed money missing i ask the XXXX pnc users and the said money has disappeared and when we look it up online it shows where it has bin tltaken out but it doesnt show witch card number i had atleast XXXX dollars in this card and for it just to be gone and not able to do anything is outrageous can u help please and thank you.','','2016-09-20',1,0),(936,127,5,13,1,'XXXX has been reporting my past due bill since 2008. This year marks the 7th year that is suppose to fall of my credit report. Collection agencies are buying collection debts that are 7 years older and putting them back on peoples credit file for another 7 years. This is causing me a great deal of stress when i know, they ca n\'t do this. Its being reported back on my credit file but under a collection agency not XXXX. XXX