 have never had problems with my account as bad as I have in the last few months with the roll-out of the new site. \n\nTonight, I spent one hour trying very hard to access my account online and then trying to transfer funds. Along the way, I made two phone calls to FHB Online where I spoke with a total of four representatives. Not one of them had even the slightest clue of how badly the site was performing. Specifically, every time I tried to perform ANY operation, the site automatically displayed an error message. When I tried to make an external transfer FHB Online stopped the attempted transaction and said it would send a code to my phone for verification. But FHB never called my phone -- even after an hour. The broken system did nearly the same thing when I tried to ( re ) add my XXXX account as an external account. FHB displayed a message that my XXXX account credentials were invalid. ( Yet these were the same credentials that I have been using on my XXXX account for years. So there was nothing wrong with my XXXX online ID, password, or pin. ) But far and away, the very worst issue was my truly sad experience with \" XXXX \'\' in the Online Banking Department. ( She said it was bank policy to refuse to provide her last name or even an employee number. ) Despite the incredible amount of time XXXX and I spent on the phone with her asking me the same questions over-and-over again, she could not understand that the FHB site was not performing as she expected it to. For example, she insisted there would be a blue arrow in front of my name. After asking me about this three times, I refused to answer the same question anymore. I had enough with the FHB site and its employees who were deeply in the dark about the site \'s issues. \n\nThere is obviously something seriously wrong with the FHB website. It is not performing adequately. While I was on the phone with FHB, I had absolutely no problem accessing my XXXX and XXXX accounts. So the issue is not my connection -- and hopefully not even my XXXX browser. Clearly my access to funds through the site is blocked. But I am far more concerned with FHB \'s employees \' inability to troubleshoot, assist, or even acknowledge something is wrong.','Company believes complaint represents an opportunity for improvement to better serve consumers','2017-04-04',1,0),(975,8,2,2,52,'','','2014-06-24',1,0),(976,10,1,15,46,'','','2014-01-26',1,0),(977,17,1,1,57,'','','2015-02-15',1,1),(978,198,7,14,17,'','','2015-01-14',1,0),(979,89,7,22,17,'','','2013-03-28',1,0),(980,2,2,2,43,'','Company chooses not to provide a public response','2015-04-22',1,0),(981,27,7,17,13,'','Company has responded to the consumer and the CFPB and chooses not to provide a public response','2017-04-04',1,0),(982,67,5,13,29,'','','2014-07-29',1,0),(983,174,7,17,17,'','Company believes it acted appropriately as authorized by contract or law','2017-04-10',1,0),(984,236,5,10,52,'','Company believes it acted appropriately as authorized by contract or law','2015-07-01',1,1),(985,5,1,1,57,'','','2012-10-02',1,0),(986,8,2,32,30,'I tried to register with credit cards so I could see my credit report and score. Well when in want to set up my account and put in my info i got to where they were asking the questions2 identify me and all but 1 of the questions had nothing to do with me so i answered none of the above because it was asking about a mortgage loan companys name and car loan payment amount that I had never heard about or seen before to verify my identity so I thought it was a trick question for both if them so as I said I answered none of the above. Well it would n\'t verify my identity since it said i got them wrong. Well so then I tried to scan my license front and back as it requested for 4 and half hours over and over to get to my report 2 make sure no1 had taken my identity and a loan in my name but it would n\'t confirm with the scans of my drivers license either. So tgen I wrote the company XXXX and told thrm my issue and they responded that they were sorry that if I ca n\'t be verified then I ca n\'t get and register an account with them for my reports that I would have to request the reports individually on the XXXX websites. So i went to the XXXX bureaus I requested all XXXX. I only ended up with my XXXX report and none of the otuer XXXX because I had the same problem with 1 of them in answering the verifying personal account questions and the other said i already requested my report this year but i did n\'t the only time I have applied was to XXXX and i never made it thru 2 get or request my reports on their site. So I \'m having MAJOR issues and I \'m worried that this is happening that some1 has likely gotten a hold of my identity and need some help getting 2 the bottom of this please ... .ASAP if at all possible im case it is identity theft. Thank u.','Company has responded to the consumer and the CFPB and chooses not to provide a public response','2017-03-18',1,0),(987,31,1,1,6,'','','2014-04-23',1,0),(988,8,2,2,13,'','Company chooses not to provide a public response','2015-06-10',1,0),(989,22,5,10,38,'','','2016-04-22',1,0),(990,6,9,73,52,'US Bank Corp denied me the ability to rescind a credit card offer violating federal law.','Company chooses not to provide a public response','2015-09-18',1,0),(991,27,7,14,34,'','Company has responded to the consumer and the CFPB and chooses not to provide a public response','2017-04-05',1,0),(992,8,2,2,19,'','Company has responded to the consumer and the CFPB and chooses not to provide a public response','2016-06-20',1,0),(993,49,7,17,57,'','','2014-06-12',1,0),(994,121,4,48,42,'I closed my Key Bank account in XXXX. I had a credit card linked with the bank and asked to close that as well which they said they could and did. I told customer service at this time that I have not received a bill for the credit card either by email or by mail and they said it was just being sent out and I would receive it in the next few weeks. I am in the market to buy a house and found out that Key Bank put a nonpayment on my credit report. I called customer service again in XXXX several times, each time being disconnected or being passed around to the wrong department. My initial {$29.00} bill had become {$130.00}. I had still not received a billing statement and did not want to pay all the late fees etc and admit that I was at fault without a bill. After several more calls in XXXX, and being passed around to different bank departments I was still not able to talk with the right people regarding paying my bill and fixing my credit. I contacted the bank in XXXX and was told they would request all the fees dismissed and asked me to call back in a few days. I called back and was told all fees were dropped but they had no authority to fix my credit even though they stated they were at fault. I paid the {$29.00} that I owed and was told that I would have to submit a complaint to the cfpb to have my credit fixed. I am very angry that my credit can be destroyed without my knowledge when I am not at fault. It has cost me much time in phone calls, disconnects etc. I am waiting for it to be fixed so that I can get a mortgage without having to pay a higher interest rate. Key Bank customer service stated that this has been happening to other customers but it seems like they have done nothing to fix the problem of billing and causing hardship to customers.','','2016-12-14',1,0),(995,43,4,16,59,'','','2016-02-09',1,1),(996,17,5,5,6,'','','2013-09-11',1,0),(997,30,7,22,52,'','','2016-06-29',1,1),(998,43,4,74,6,'','','2013-06-05',1,1),(999,77,4,75,46,'','','2013-11-04',1,0),(1000,237,5,13,26,'','','2016-08-31',0,0);
